INSERT INTO `product` (`id_product`, `id_manufacturer`, `name`, `description`, `compound`, `counte`, `price`, `gram`, `cover`) VALUES
(1, 1, 'Animal Flex', 'Animal Flex разработан, чтобы сделать Ваши суставы и связки более крепкими и чтобы защитить их от перегрузок во время тренировок. Каждый пакетик Animal Flex состоит из нескольких ключевых комплексов веществ, защищающих Ваши суставы: (1) мощный комплекс, помогающий восстановить соединительную ткань; (2) комплекс веществ, улучшающих смазку суставов и смягчающих тем самым стресс от поднятия тяжестей на тренировке; (3) комплекс, способствующий восстановлению связок и снимающий воспаление; (4) витаминно-минеральная смесь, которая еще более способствует сохранению и поддержанию здоровья суставов и связок. Animal Flex — это полная и эффективная формула для достижения серьезного результата. Это Ваше надежное оружие в «железной» борьбе.', 'Порция - 1 пакетик\r\nКоличество порций - 44\r\n \r\nЭнергетическая ценность	9 ккал\r\nВсего жиров	1 г\r\nВитамин С (аскорбиновая кислота)	100 мг\r\nВитамин Е (ди-альфа токоферол)	100 мг\r\nЦинк (цинк пиколинат)	15 мг\r\nСелен (натрия селенит)	70 мкг\r\nМарганец (марганца сульфат)	1 мг\r\nJoint Construction Complex	3000 мг\r\nГлюкозамин (HCl и сульфат KCI)\r\nМетилсульфонилметан (MSM)\r\nХондроитин сульфат А (CSA)\r\nХондроитин сульфат B (CSB)\r\nJoint Lubrication Complex	1000 мг\r\nЛьняное масло (50% линоленовая кислота)\r\nЦетил миристолеат специальная смесь (цетил миристолеат, цетил миристат, цетил пальмитат, цетил лаурат, цетил пальмитолеат, цетил олеат)\r\nГиалурон\r\nJoint Support Complex	1000 мг\r\nЭкстракт корня имбиря (gingerols, shogaols)\r\nЭкстракт куркумы\r\nBoswellia (boswellic acid)\r\nКверцетин\r\nБромелаин\r\n \r\nДругие ингредиенты: Дикальций фосфат, сывороточный протеин (молоко), shark cartilage, желатин, глицерин, соевое масло, очищенная вода, стеарат магния, стеариновая кислота.', 100, 5, 2000, );
INSERT INTO `product` (`id_product`, `id_manufacturer`, `name`, `description`, `compound`, `counte`, `price`, `gram`, `cover`) VALUES
(3, 1, '100% WHEY GOLD STANDARD, 2LB(907G)', 'Миллионы покупателей довольны Optimum Nutrition 100% WHEY GOLD STANDARD, и они  не могут быть неправы!\r\nЕще на заре производства протеинов Optimum Nutrition установил стандарт, в соответствии с которым стали производиться все последующие ингредиенты сывороточного протеина. Теперь мы устанавливаем новый стандарт, с третьим поколением Optimum Nutrition 100% WHEY GOLD STANDARD.\r\nПодобно предшественникам, ON 100% WHEY GOLD STANDARD содержит в себе первоклассные оптимальные пищевые добавки, составляющие протеиновую смесь:\r\nМикрофильтрованный изолят сывороточного белка.\r\nИонно-обменный изолят сывороточного белка.\r\nУльтрафильтрованный концентрат сывороточного белка.\r\nПептиды молочной сыворотки.\r\nON 100% WHEY GOLD STANDARD это чистый, настоящий сывороточный белок, с минимальным содержанием жиров, насыщенных жиров, холестерина, лактозы и других углеводов. В действительности, Optimum Nutrition 100% WHEY GOLD STANDARD это лучший продукт из доступных на рынке спортивного питания!\r\nИ вот почему:\r\nON 100% WHEY GOLD STANDARD содержит больше изолята сывороточного белка – это самый чистый и самый дорогой источник сывороточного белка.\r\nБолее высокий процент содержания белка. ON 100% WHEY GOLD STANDARD всегда был лидером в этом отношении. Теперь с 24 граммами белка всего лишь в одной порции (см. состав), это - почти 82%-ый белковый концентрат\r\nOptimum Nutrition 100% Whey Gold Standard содержит низко молекулярные пептиды сыворотки, благодаря которым протеин стал более быстродействующим!\r\nON 100% WHEY GOLD STANDARD содержит лактазу и аминоген – ферменты, улучшающие переваривание пищи, чтобы увеличить усвояемость белка и максимально снизить негативные реакции организма на лактозу, которую некоторые люди не переносят.\r\nON 100% WHEY GOLD STANDARD подвергнут специальной обработке для того, чтобы он был легок в приготовлении и чтобы легко размешивался.\r\nКаждая порция содержит еще больше биологически активных микрофракций сывороточного белка, включая альфа-лактальбумин, гликомакропептиды, бета-лактоглобулин, г-иммуноглобулина (lgG), лактоферрин, лактопероксидазу, и различные факторы роста.\r\nБолее, чем 4 грамма глютамина и больше, чем 5 граммов разветвленных аминокислот BCAA (лейцин, изолейцин, валин) в каждой порции!', '900 г	ванильное мороженое\r\nПорция 32 г\r\nКоличество порций 28\r\nСостав в:	32 г	100 г\r\nЭнергетическая ценность	120 ккал	375 ккал\r\nЖиры	1,50 г	4,69 г\r\nиз кот. насыщ. жиры	0,50 г	1,56 г\r\nХолестерин	40 мг	125 мг\r\n(для вкуса клубника)	55 мг	171,88 мг\r\nНатрий	130 мг	406,25 мг\r\n(для вкуса шоколад-ментол)	110 мг	343,75 мг\r\nУглеводы	3 г	9,38 г\r\nиз кот. сахар	2 г	6,25 г\r\nБелок	24 г	75 г\r\nСостав аминокислот:\r\nНезаменимые аминокислоты	≈11 г	≈34,38 г\r\nL-триптофан, L-валин, L-треонин, L-изолейцин, L-лейцин, L-лизин, L-фенилаланин, L-метионин\r\nУсловно незаменимые аминокислоты	≈7,70 г	≈24,06 г\r\nL-аргинин, L-цистеин, L-тирозин, L-гистидин, L-пролин, L-глютамин и глютаминовая кислота\r\nЗаменимые аминокислоты	≈5,30 г	≈16,56 г\r\nL-аспарагиновая кислота, L-серин, L-глицин, L-аланин\r\n', 789, 19, 900, );
INSERT INTO `product` (`id_product`, `id_manufacturer`, `name`, `description`, `compound`, `counte`, `price`, `gram`, `cover`) VALUES
(4, 5, 'HYDRO WHEY ZERO ОТ BIOTECH', 'Hydro Whey Zero от BioTech USA как источник сывороточного гидролизата поможет вам быстро насыщать мышцы строительным материалом. Особенно это ценно до и после тренировки для предупреждения катаболизма и ускорения восстановительных процессов. В каждой порции данного протеина содержится 23 г белка, из которых 5 г приходится на BCAA. В нем нет лактозы и глютена, а порция жиров и углеводов минимальная, поэтому данный протеин можно использовать и во время сушки или диеты.\r\n\r\n\r\nBioTech USA Hydro Whey Zero:\r\n\r\nСывороточный гидролизат;\r\n23 г белка в каждой порции, из них 5 г BCAA;\r\nС аргинином;\r\nБез лактозы и глютена;\r\nНизкий уровень жиров и углеводов;\r\nБыстро усваивается;\r\nСпособствует сохранению мышечной массы;\r\nСтимулирует рост мышц;\r\nПредупреждает катаболизм.\r\nСывороточный гидролизат для борьбы с катаболизмом и сохранения мышечной массы\r\nСывороточный гидролизат широко используется в спортивном питании. Основное его преимущество заключается в том, что он быстро усваивается организмом. По скорости всасывания ему нет равных. В сывороточном гидролизате белок разложен до пептидов, которые, согласно исследованиям, усваиваются быстрее, чем аминокислоты в свободной форме.\r\n\r\nСнабжая себя сывороточным гидролизатом, вы даете мгновенный приток аминокислот к мышцам. Главную ценность это имеет сразу после тренировки, когда мышцы нуждаются в ресурсах для быстрого восстановления и роста и предупреждения мышечного катаболизма. Аминокислотный профиль сывороточного гидролизата характеризуется высоким содержанием наиболее важных аминокислот для мышечного восстановления - BCAA и глютамина, поэтому он так высоко ценится в бодибилдинге. В нем также присутствуют все незаменимые аминокислоты, которые необходимы для запуска синтеза мышечного белка.\r\n\r\nАргинин для улучшения мышечного пампинга\r\n\r\nАргинин, включенный в формулу данного протеина, полезен для нашего организма как прекурсор оксида азота. Данное соединение способствует расширению кровеносных сосудов и улучшению кровоснабжения. В итоге к каждой клеточке доставляется больше кислорода и других ценных питательных веществ, больше аминокислот и глюкозы, необходимых для восстановления и роста мышечной ткани.', 'Состав Hydro Whey Zero на порцию (25 г):\r\n\r\nЭнергетическая ценность — 93 Ккал\r\n\r\nБелки — 23 г (сывороточный гидролизат)\r\n\r\nЖиры — 0,1 г (из них 0,06 г насыщенных)\r\n\r\nУглеводы — 0,13 г (в том числе, 0,1 г сахара)\r\n\r\nНатрий — 0,06 г', 252, 20, 180, );
INSERT INTO `product` (`id_product`, `id_manufacturer`, `name`, `description`, `compound`, `counte`, `price`, `gram`, `cover`) VALUES
(5, 3, '100% CASEIN GOLD STANDARD', 'Иногда медленнее — лучше, особенно, когда речь идет о скорости усвоения протеина. В то время как быстрое усвоение протеина нужно непосредственно до и после тренировки, медленное высвобождение желательно в остальное время. Казеиновый протеин чувствителен к уровню pH и кислотной среде желудка. В результате ему нужно более чем в два раза больше времени для расщепления на аминокислоты по сравнению с сывороткой и прочими протеинами. Казеин — это самый распространенный протеин в коровьем молоке. Считается, что это высококачественный протеин, поскольку он легко ассимилируется и дает достаточное количество аминокислот, которые не могут быть синтезированы самим организмом.\r\n\r\nЕще одно полезное свойство казеина заключается в том, что он дает чувство сытости. Казеин оказывает легкое давление на стенки желудка. Со стороны желудка поступают таким образом сигналы в головной мозг о том, что желудок наполнен и надо прекратить есть. Казеин усваивается медленнее всех прочих типов протеина. Это позволяет создать эффект медленного высвобождения \"time-released\", то есть постоянный приток аминокислот в мышцы на протяжении долгого периода времени.\r\n\r\nБодибилдеры и атлеты, стремящиеся нарастить чистую мышечную массу, сократят время восстановления и смогут избежать мышечного разрушения благодаря 100% Casein Gold Standard. Также могут получить большую пользу от данного продукта лица, заинтересованные в улучшении качества своего сна.\r\n\r\nИсследования казеина\r\n\r\nПожалуй, самое интересное исследование казеина, исследование Буари, установило, что казеин примерно на 30% увеличивает протеиновый синтез, а также уменьшает катаболизм на 34%. Но более важно, что казеин способствует сохранению положительного баланса азота в течение 7 часов после употребления.\r\n\r\nДругое исследование обратило внимание на эффект казеина, когда его использовали в программе 12-недельной тяжелоатлетической программы. Участники были разделены на две группы, каждая из которых придерживалась сбалансированной диеты, включая 75 г добавочного протеина в день. Отличие было только в источнике используемого протеина: в то время как первая группа использовала протеиновые коктейли, в основе которых была сыворотка, вторая группа использовала молочные протеиновые изоляты (80% казеина, 20% сыворотки). В конце исследования группа, использовавшая изолят молочного протеина, сбросила больше лишнего жира (7 кг против 4,2 кг), набрала больше чистой массы (4 кг против 2 кг), а также в целом стала сильнее, чем группа, использовавшая сыворотку.', '908 г	шоколад\r\nПорция 33 г\r\nКоличество порций 28\r\nСостав в:	33 г	100 г\r\nЭнергетическая ценность	120 ккал	363 ккал\r\nБелок	24 г	72,73 г\r\nУглеводы	3 г	9,09 г\r\n(для вкуса клубника)	4 г	12,12 г\r\nиз кот. клетчатка	1 г	3,03 г\r\n(для вкуса шоколад и кекс)	0 г	0 г\r\nиз кот. сахар	1 г	3,03 г\r\nЖир	1 г	3,03 г\r\nиз кот. насыщ. жиры	0,50 г	1,52 г\r\nХолестерин	15 мг	45,45 мг\r\n(для вкуса клубника)	20 мг	60,61 мг\r\nНатрий	240 мг	727,27 мг\r\n(для вкуса кекс)	260 мг	787,88 мг\r\n(для вкуса клубника)	90 мг	272,73 мг\r\nСостав аминокислот\r\nНезаменимые аминокислоты	≈9,60 г	≈29,09 г\r\nL-триптофан, L-валин, L-треонин, L-изолейцин, L-лейцин, L-лизин, L-фенилаланин, L-метионин\r\nУсловно незаменимые аминокислоты	≈10,30 г	≈32,21 г\r\nL-аргинин, L-цистеин, L-тирозин, L-гистидин, L-пролин, L-глютамин и глютаминовая кислота\r\nЗаменимые аминокислоты	≈4,10 г	≈12,42 г\r\nL-аспарагиновая кислота, L-серин, L-глицин, L-аланин\r\nДругие ингредиенты:\r\nМицеллярный казеин, какао, натуральные и искусственные ароматизаторы, инулин, соль, лецитин,для вкуса печенье-крем- крошки печенья [обогащенный краситель-пшеничная мука,ниацин,восстановленное железо,тиамин моногидрат,ребофлавин,яблочная кислота],сахар,смесь пальмового масла,высокофруктозный кукурузный сироп,кукурузная мука)декстроза,натрий бикарбокат,соевый лецитин; целлюлозная камедь, ксантановое гумми, каррагенин, сукралоза, Aminogen®,ацесульфам калия.', 242, 5, 908, );
