(6, 5, '100% WHEY GOLD STANDARD NATURAL', '100% Whey Gold Standard NATURAL\r\nБез искусственных ароматизаторов, красителей, подсластителей.\r\nСывороточный изолят в качестве основного источника белка.\r\nВысокое содержание сывороточного белка.\r\nБыстрые усвоение, гидролизованный белок с пептидами.\r\nМикрофракции белка.\r\nБолее 5 грамм ВСАА.\r\nБолее 4 граммов глютамина и прекурсоров.\r\nЛегко размешивается ложкой.\r\n100% Whey Gold Standard NATURAL - не содержит искусственных компонентов и вырабатывается из высококачественного молока путем низкотемпературной обработки, что позволяет сохранить биологически активные микрофракции.\r\n\r\n100% Whey Gold Standard NATURAL проходит процессы концентрации, ультрафильтрации, ионозамещения и перекрестной микрофильтрации, что позволяет полностью отделить холестерин и лактозу. Это делает продукт идеальным при низкожировой и низкоуглеводной диете.\r\n\r\n \r\n\r\nРекомендации по применению\r\nПринимать продукт по 1 мерной ложке 2-3 раза в день.\r\n\r\nДля наилучших результатов следует принимать продукт по 1-2 мерных ложки в течение 45 минут после высокоинтенсивных тренировок, за 1 час до тренеровки и с утренним приемом пищи (часто рекомендуют и прием протеиновых коктейлей через 2-3 часа после тренинга).\r\n\r\nДобавить 1-2 мерные ложки на 300-500 мл нежирного молока, воды или сока и в течение 10 секунд взбивать в миксере или ложкой, употреблять желательно сразу.', '2270 г	натуральная ваниль\r\nПорция - 32 г\r\nКоличество порций - 71\r\nСостав в одной порции (32 гр):\r\nЭнергетическая ценность	130 ккал\r\n- калорий из жира	10 ккал\r\nПитательная ценность:\r\nБелки	24 гр\r\nУглеводы	5 гр\r\nиз сахаров	3 гр\r\nЖиры	1 гр\r\nнасыщенные жиры	0,5 гр\r\nХолестерин	30 мг\r\nНатрий	60 мг\r\nL-триптофан	405 мг\r\nL-валин(ВСАА)	1422 мг\r\nL-треонин	1654 мг\r\nL-изолейцин(ВСАА)	1573 мг\r\nL-лейцин(ВСАА)	2531 мг\r\nL-лизин	2233 мг\r\nL-фенилаланин	748 мг\r\nL-метионин	492 мг\r\nL-аргинин	505 мг\r\nL-цистин	494 мг\r\nL-тирозин	703 мг\r\nL-гистидин	423 мг\r\nL-пролин	1509 мг\r\nL-глютамин	4082 мг\r\nL-аспарагиновая кислота	2508 мг\r\nL-серин	1126 мг\r\nL-глицин	412 мг\r\nL-аланин	1180 мг\r\nИнгредиенты\r\nПротеиновая смесь (изолят сывороточного протеина, концентрат сывороточного протеина, сывороточные пептиды),сгущенный порошок сока тростника, натуральные ароматизаторы, лецитин,ксантановая камедь,rebaudioside A,лактаза.', 127, 23, 2300, );

